import React from 'react';
import {
  Box,
  UnorderedList,
  ListItem,
  ModalBody,
  Image,
  Button,
} from '@chakra-ui/react';

const CodeIt = () => {
  return (
    <Box mt={2}>
      <Button colorScheme="red">Try Now</Button>
      <Button>View Source Code</Button>
      <ModalBody>Hello, here is some content placeholer</ModalBody>
    </Box>
  );
};

export default CodeIt;
